pragma solidity ^0.8.13;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/IERC721Enumerable.sol";
import "./IKSSinglePool.sol";
import "./IKSFactory.sol";
import "./IKSLP.sol";

interface IGaiaStableDAO is IERC721Enumerable {
    function mint(address to, uint256 tokenId) external returns (bool);

    function burn(uint256 tokenId) external;
}

interface IGaiaStableDAOOperator {
    event UpdateDevFund(address newDevFund);
    event BuyBack(address indexed user, uint256 indexed id);
    event ClaimInterest(uint256 amountOfKUSDT, uint256 amountOfKSP);
    event ClaimKSPReward(uint256 amountOfKSP);
    event EmergencyWithdraw(uint256 amountOfKUSDT, uint256 amountOfKSP);
    event SetPriceForII(uint256 priceForII);

    function stableDAO() external view returns (IGaiaStableDAO);

    function gaiaKronos() external view returns (address);

    function gaiaSupernova() external view returns (address);

    function KUSDT() external view returns (IERC20);

    function KSP() external view returns (IERC20);

    function KUSDT_KS_POOL() external view returns (IKSSinglePool);

    function KUSDT_KLAY_LP() external view returns (IKSLP);

    function PUBLICPRICE() external view returns (uint256);

    function BUYBACKPRICE() external view returns (uint256);

    function devFund() external view returns (address);

    function whitelistedAmount(address user) external view returns (uint256);

    function isListedII(address ii) external view returns (bool);

    function getBurnedIds() external view returns (uint16[] memory);

    function burnedTokensAmount() external view returns (uint256);

    function mintStableDAO(uint256 amount, address nft) external;

    function mintStableDAOAsII(uint256 amount, address[] calldata path) external payable;

    function estimateNeededKlayForZapping(uint256 totalKUSDTAmount) external view returns (uint256 neededKlay);

    function mintedAmountWithGaiaKronos(address user) external view returns (uint256);

    function mintedAmountWithGaiaSupernova(address user) external view returns (uint256);

    function buyBack(uint256[] calldata ids) external;
}

