pragma solidity ^0.8.13;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "../interfaces/IKSSinglePool.sol";

contract KSinteractContract {
    IERC20 internal constant KUSDT = IERC20(0xceE8FAF64bB97a73bb51E115Aa89C17FfA8dD167);
    IKSSinglePool internal constant KUSDT_KS_POOL = IKSSinglePool(0x4B419986E15018E6Dc1C9DAb1fa4824D8E2E06B5);
    address internal immutable _owner;

    event Before(uint256 cash, uint256 tb, uint256 ts, uint256 ers);
    event After(uint256 cash, uint256 tb, uint256 ts, uint256 ers);

    constructor() {
        _owner = msg.sender;
        KUSDT.approve(address(KUSDT_KS_POOL), 100e6);
    }

    function deposit(uint256 amount) external {
        require(_owner == msg.sender);
        KUSDT.transferFrom(msg.sender, address(this), amount);
        emit Before(
            KUSDT_KS_POOL.getCash(),
            KUSDT_KS_POOL.totalBorrows(),
            KUSDT_KS_POOL.totalSupply(),
            KUSDT_KS_POOL.exchangeRateStored()
        );
        KUSDT_KS_POOL.depositKct(amount);
        emit After(
            KUSDT_KS_POOL.getCash(),
            KUSDT_KS_POOL.totalBorrows(),
            KUSDT_KS_POOL.totalSupply(),
            KUSDT_KS_POOL.exchangeRateStored()
        );
    }

    function withdraw1(uint256 kusdtAmount) external {
        require(_owner == msg.sender);
        KUSDT_KS_POOL.withdraw(kusdtAmount);
    }

    function withdraw2(uint256 ikusdtAmount) external {
        require(_owner == msg.sender);
        KUSDT_KS_POOL.withdrawByAmount(ikusdtAmount);
    }

    function withdrawUSDT(uint256 amount) external {
        require(_owner == msg.sender);
        KUSDT.transfer(msg.sender, amount);
    }
}

