contracts/StableDAORewardDistributor.sol.content:
pragma solidity ^0.8.13;

import "./interfaces/IStableDAORewardDistributor.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./libraries/MerkleProof.sol";
import "@openzeppelin/contracts/utils/structs/BitMaps.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract StableDAORewardDistributor is Ownable, ReentrancyGuard, IStableDAORewardDistributor {
    using SafeERC20 for IERC20;
    using Address for address payable;

    address public constant KLAY = address(0);

    struct Reward {
        address token;
        uint256 amount; //기록용 amount
        bytes32 merkleRoot;
    }

    Reward[] public rewards;
    mapping(address => BitMaps.BitMap) internal _rewardCollectedBitMap;
    mapping(address => bool) public isDepositor;

    constructor() {
        isDepositor[msg.sender] = true;
        // UpdateDepositor(msg.sender, true);
    }

    fallback() external payable {}
    receive() external payable {
        // solhint-disable-previous-line no-empty-blocks
    }

    function _setRewardCollectedBitMap(address user, uint256 rewardId) internal {
        BitMaps.set(_rewardCollectedBitMap[user], rewardId);
    }

    function _isRewardCollected(address user, uint256 rewardId) internal view returns (bool) {
        return BitMaps.get(_rewardCollectedBitMap[user], rewardId);
    }

    function isRewardCollected(address user, uint256 rewardId) external view returns (bool) {
        return _isRewardCollected(user, rewardId);
    }

    //onlyDepositor
    function updateDepositor(address depositor, bool status) external onlyOwner {
        bool lastStatus = isDepositor[depositor];
        require(lastStatus != status, "STATUS_NOT_CHANGED");
        isDepositor[depositor] = status;
        // UpdateDepositor(depositor, status);
    }

    function depositReward(
        address token,
        uint256 amount,
        bytes32 merkleRoot
    ) external payable returns (uint256 rewardId) {
        require(isDepositor[msg.sender], "UNAUTHORIZED");
        require(amount != 0, "AMOUNT_0");
        if (token == KLAY) {
            require(msg.value == amount, "WRONG_MSG.VALUE");
        } else {
            IERC20(token).transferFrom(msg.sender, address(this), amount);
        }

        rewardId = rewards.length;
        rewards.push(Reward({token: token, amount: amount, merkleRoot: merkleRoot}));
        // emit Distribute(token, amount, merkleRoot, rewardId);
    }

    function claimRewards(
        uint256[] calldata rewardIds,
        uint256[] calldata amounts,
        bytes32[][] calldata proof
    ) external nonReentrant {
        uint256 length = rewardIds.length;
        require(amounts.length == length && proof.length == length, "LENGTH_NOT_EQUAL");

        for(uint256 i = 0; i < length; i++) {
            _claim(msg.sender, rewardIds[i], amounts[i], proof[i]);
        }
    }

    function _claim(
        address user,
        uint256 rewardId,
        uint256 amount,
        bytes32[] calldata proof
    ) internal {
        bytes32 leaf = keccak256(abi.encodePacked(user, amount));
        Reward storage reward = rewards[rewardId];
        require(!_isRewardCollected(user, rewardId), "ALREADY_CLAIMED");
        require(MerkleProof.verify(proof, reward.merkleRoot, leaf), "VERIFICATION_FAILED");

        _setRewardCollectedBitMap(user, rewardId);

        address token = reward.token;
        if (token == KLAY) {
            payable(user).sendValue(amount);
        } else {
            IERC20(token).safeTransfer(user, amount);
        }
        // emit Claim(user, rewardId, token, amount);
    }

    function claimRewardsByOwner(
        address[] calldata users,
        uint256[] calldata rewardIds,
        uint256[] calldata amounts,
        bytes32[][] calldata proof
    ) external nonReentrant onlyOwner {
        uint256 length = users.length;
        require(rewardIds.length == length && amounts.length == length && proof.length == length, "LENGTH_NOT_EQUAL");

        for(uint256 i = 0; i < length; i++) {
            _claim(users[i], rewardIds[i], amounts[i], proof[i]);
        }
    }

    function emergencyWithdraw(address token) external onlyOwner {
        uint256 amount;
        if (token == KLAY) {
            amount = address(this).balance;
            payable(msg.sender).sendValue(amount);
        } else {
            amount = IERC20(token).balanceOf(address(this));
            IERC20(token).safeTransfer(msg.sender, amount);
        }
        // emit EmergencyWithdraw(token, amount)
    }
}

