contracts/GaiaStableDAOOperator.sol.content:
pragma solidity ^0.8.13;

import "./interfaces/IGaiaStableDAOOperator.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract GaiaStableDAOOperator is Ownable, ReentrancyGuard, IGaiaStableDAOOperator {
    using SafeERC20 for IERC20;
    using Address for address payable;

    IGaiaStableDAO public immutable stableDAO;
    address public immutable gaiaKronos;
    address public immutable gaiaSupernova;

    IERC20 public immutable KUSDT;
    IERC20 public immutable KSP;
    IKSSinglePool public immutable KUSDT_KS_POOL;
    IKSLP public immutable KUSDT_KLAY_LP;

    // gaiaKronos = 0xBb915237D8b46Dcdfe813c914Bf98708e0dAd84A;
    // gaiaSupernova = 0x89a18aBAB20aaB069feB7cab20517630Ee7C1626;
    // KUSDT = 0xceE8FAF64bB97a73bb51E115Aa89C17FfA8dD167;
    // KSP = 0xC6a2Ad8cC6e4A7E08FC37cC5954be07d499E7654;
    // KUSDT_KS_POOL = 0x4B419986E15018E6Dc1C9DAb1fa4824D8E2E06B5;
    // KUSDT_KLAY_LP = 0xD83f1B074D81869EFf2C46C530D7308FFEC18036;

    uint256 public constant PUBLICPRICE = 1300e6;
    uint256 public constant BUYBACKPRICE = 1200e6;

    uint256 internal priceForII; //institutional investors 기관투자자.
    uint256 internal constant PRICEWITHSUPERNOVA = 1250e6;

    mapping(address => uint256) public mintedAmountWithGaiaKronos;
    mapping(address => uint256) public mintedAmountWithGaiaSupernova;

    mapping(address => uint256) public whitelistedAmount;
    mapping(address => bool) public isListedII;

    address public devFund;
    uint16[] internal _burnedIds;

    fallback() external payable {}

    receive() external payable {
        // solhint-disable-previous-line no-empty-blocks
    }

    function getBurnedIds() external view returns (uint16[] memory) {
        return _burnedIds;
    }

    function burnedTokensAmount() external view returns (uint256) {
        return _burnedIds.length;
    }

    function updateDevFund(address newDevFund) external onlyOwner {
        require(devFund != newDevFund, "NOT_CHANGED");
        devFund = newDevFund;
        emit UpdateDevFund(newDevFund);
    }

    constructor(
        IGaiaStableDAO _stableDAO,
        address _gaiaKronos,
        address _supernova,
        address _KUSDT,
        address _KSP,
        address _KUSDT_KS_POOL,
        address _KUSDT_KLAY_LP,
        address _devFund
    ) {
        require(
            address(_stableDAO) != address(0) &&
                _gaiaKronos != address(0) &&
                _supernova != address(0) &&
                _KUSDT != address(0) &&
                _KSP != address(0) &&
                _KUSDT_KS_POOL != address(0) &&
                _KUSDT_KLAY_LP != address(0) &&
                _devFund != address(0),
            "WRONG_ADDRESS"
        );

        stableDAO = _stableDAO;
        gaiaKronos = _gaiaKronos;
        gaiaSupernova = _supernova;
        KUSDT = IERC20(_KUSDT);
        KSP = IERC20(_KSP);
        KUSDT_KS_POOL = IKSSinglePool(_KUSDT_KS_POOL);
        KUSDT_KLAY_LP = IKSLP(_KUSDT_KLAY_LP);
        devFund = _devFund;
    }

    function setWhitelist(address[] calldata users, uint256[] calldata tickets) external onlyOwner {
        require(users.length == tickets.length, "LENGTH_NOT_EQUAL");

        for (uint256 i = 0; i < users.length; i++) {
            whitelistedAmount[users[i]] = tickets[i];
        }
    }

    function setPriceForII(uint256 _priceForII) external onlyOwner {
        require(_priceForII >= BUYBACKPRICE, "INVALID_PRICEFORII");

        priceForII = _priceForII;
        emit SetPriceForII(_priceForII);
    }

    function setIIList(address[] calldata iis, bool[] calldata eligible) external onlyOwner {
        require(iis.length == eligible.length, "LENGTH_NOT_EQUAL");

        for (uint256 i = 0; i < iis.length; i++) {
            isListedII[iis[i]] = eligible[i];
        }
    }

    function mintStableDAO(uint256 amount, address nft) external {
        require(amount != 0, "INVALID_AMOUNT");
        uint256 price = PUBLICPRICE;
        if (nft == gaiaKronos) {
            price = BUYBACKPRICE;
            uint256 _mintedAmountWithGaiaKronos = mintedAmountWithGaiaKronos[msg.sender];
            uint256 gaiaKronosBalance = IERC721(gaiaKronos).balanceOf(msg.sender);

            require(_mintedAmountWithGaiaKronos + amount <= gaiaKronosBalance, "NOT_ENOUGH_GAIA_KRONOS");
            mintedAmountWithGaiaKronos[msg.sender] = _mintedAmountWithGaiaKronos + amount;
        } else if (nft == gaiaSupernova) {
            price = PRICEWITHSUPERNOVA;
            uint256 _mintedAmountWithSupernova = mintedAmountWithGaiaSupernova[msg.sender];
            uint256 gaiaSupernovaBalance = IERC721(gaiaSupernova).balanceOf(msg.sender);

            require(_mintedAmountWithSupernova + amount <= gaiaSupernovaBalance, "NOT_ENOUGH_GAIA_SUPERNOVA");
            mintedAmountWithGaiaSupernova[msg.sender] = _mintedAmountWithSupernova + amount;
        } else if (nft == address(0xFFfFfFffFFfffFFfFFfFFFFFffFFFffffFfFFFfF)) {
            //화이트리스팅.
            price = BUYBACKPRICE;
            uint256 _whitelistedAmount = whitelistedAmount[msg.sender];
            require(_whitelistedAmount > 0, "NOT_IN_WHITELIST");
            require(amount <= _whitelistedAmount, "AMOUNT_EXCEED_TICKETS");
            unchecked {
                whitelistedAmount[msg.sender] = _whitelistedAmount - amount;
            }
        } else {
            require(nft == address(0), "INVALID_NFT");
        }

        KUSDT.transferFrom(msg.sender, address(this), price * amount);
        if (price != BUYBACKPRICE) {
            require(devFund != address(0), "FUND_ADDRESS_0");
            KUSDT.transfer(devFund, (price - BUYBACKPRICE) * amount);
        }
        _deposit(amount);

        _mintTokenWithCheckingBurnedList(msg.sender, amount);
    }

    function _mintTokenWithCheckingBurnedList(address user, uint256 amount) internal {
        uint256 burnedAmount = _burnedIds.length;
        if (burnedAmount > amount) {
            for (uint256 i = 0; i < amount; i++) {
                stableDAO.mint(user, uint256(_burnedIds[burnedAmount - 1 - i]));
                _burnedIds.pop();
            }
        } else {
            // burnedAmount <= amount
            for (uint256 i = 0; i < burnedAmount; i++) {
                stableDAO.mint(user, uint256(_burnedIds[i]));
            }
            if (burnedAmount != 0) delete _burnedIds;

            if (burnedAmount < amount) {
                uint256 currentId = stableDAO.totalSupply();
                for (uint256 i = 0; i < amount - burnedAmount; i++) {
                    stableDAO.mint(user, currentId + i);
                }
            }
        }
    }

    function mintStableDAOAsII(uint256 amount, address[] calldata path) external payable nonReentrant {
        require(isListedII[msg.sender], "NOT_ELIGIBLE_II");
        require(amount != 0, "INVALID_AMOUNT");
        uint256 _priceForII = priceForII;
        require(_priceForII > 0, "INVALID_PRICEFORII");

        uint256 klayBalance0 = address(this).balance;
        IKSFactory(address(KSP)).exchangeKlayNeg{value: msg.value}(address(KUSDT), _priceForII * amount, path);
        uint256 usedKlayForZapping = klayBalance0 - address(this).balance;
        uint256 diff = msg.value - usedKlayForZapping;
        if (diff > 0) payable(msg.sender).sendValue(diff);
        if (_priceForII != BUYBACKPRICE) {
            require(devFund != address(0), "FUND_ADDRESS_0");
            KUSDT.transfer(devFund, (_priceForII - BUYBACKPRICE) * amount);
        }
        _deposit(amount);
        _mintTokenWithCheckingBurnedList(msg.sender, amount);
    }

    function estimateNeededKlayForZapping(uint256 totalKUSDTAmount) external view returns (uint256 neededKlay) {
        return KUSDT_KLAY_LP.estimateNeg(address(KUSDT), totalKUSDTAmount);
    }

    function buyBack(uint256[] calldata ids) external {
        require(ids.length > 0, "INVALID_IDS");
        for (uint256 i = 0; i < ids.length; i++) {
            require(stableDAO.ownerOf(ids[i]) == msg.sender, "UNAUTHORIZED");
            stableDAO.burn(ids[i]);
            _burnedIds.push(uint16(ids[i]));
            emit BuyBack(msg.sender, ids[i]);
        }
        uint256 totalBuyBack = ids.length * BUYBACKPRICE;
        _withdraw(totalBuyBack);
        KUSDT.transfer(msg.sender, totalBuyBack);
    }

    function _deposit(uint256 amount) internal {
        // 클레이스왑에 예치.
        uint256 amountOfKUSDT = amount * BUYBACKPRICE;
        KUSDT.approve(address(KUSDT_KS_POOL), amountOfKUSDT);
        KUSDT_KS_POOL.depositKct(amountOfKUSDT);
    }

    function _withdraw(uint256 kusdtAmount) internal {
        // 클레이스왑에서 인출.
        KUSDT_KS_POOL.withdraw(kusdtAmount);
    }

    function claimInterest() external onlyOwner {
        uint256 claimableInterest = _getTotalKUSDTDeposit() - (stableDAO.totalSupply() * BUYBACKPRICE);
        // ksp 도 자동 수령.
        _withdraw(claimableInterest);
        KUSDT.transfer(msg.sender, claimableInterest);
        uint256 balanceOfKSP = KSP.balanceOf(address(this));
        KSP.transfer(msg.sender, balanceOfKSP);
        // KSP 꺼냄.
        emit ClaimInterest(claimableInterest, balanceOfKSP);
    }

    function claimKSPReward() external onlyOwner {
        KUSDT_KS_POOL.claimReward();
        uint256 balanceOfKSP = KSP.balanceOf(address(this));
        KSP.transfer(msg.sender, balanceOfKSP);
        emit ClaimKSPReward(balanceOfKSP);
    }

    function claimableInterest() external view returns (uint256) {
        return _getTotalKUSDTDeposit() - (stableDAO.totalSupply() * BUYBACKPRICE);
    }

    function claimableKSPReward() external view returns (uint256) {
        uint256 miningIndex = KUSDT_KS_POOL.miningIndex();
        uint256 lastIndex = KUSDT_KS_POOL.userLastIndex(address(this));
        uint256 unclaimedKSP;
        if (miningIndex > lastIndex) {
            unclaimedKSP = (KUSDT_KS_POOL.balanceOf(address(this)) * (miningIndex - lastIndex)) / 1e18;
        }
        return KSP.balanceOf(address(this)) + unclaimedKSP;
    }

    //부정확함. 보통 10~100 단위로 오차 있는 듯 하고, 마지막 트랜잭션이 발생한 시점과의 블록차이가 길어질 수록 오차는 커짐.
    function _getTotalKUSDTDeposit() internal view returns (uint256) {
        return (KUSDT_KS_POOL.exchangeRateStored() * KUSDT_KS_POOL.balanceOf(address(this))) / 1e18;
    }

    function emergencyWithdraw(uint256 iKUSDTAmount) external onlyOwner {
        if (iKUSDTAmount == type(uint256).max) iKUSDTAmount = KUSDT_KS_POOL.balanceOf(address(this));
        KUSDT_KS_POOL.withdrawByAmount(iKUSDTAmount);
        uint256 balanceOfKUSDT = KUSDT.balanceOf(address(this));
        uint256 balanceOfKSP = KSP.balanceOf(address(this));

        KUSDT.transfer(msg.sender, KUSDT.balanceOf(address(this)));
        KSP.transfer(msg.sender, KSP.balanceOf(address(this)));
        emit EmergencyWithdraw(balanceOfKUSDT, balanceOfKSP);
    }

    function claimTokens(address token) external onlyOwner {
        uint256 amount;
        if (token == address(0)) {
            amount = address(this).balance;
            payable(msg.sender).sendValue(amount);
        } else {
            amount = IERC20(token).balanceOf(address(this));
            IERC20(token).safeTransfer(msg.sender, amount);
        }
    }
}

